import './Subject.css';
import Media from 'react-media';

// Current Blocked 
export default function ReturnSuBJect() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <SreenSmall />}
     {matches.medium && <SreenLarge />}
     {matches.large && <SreenLarge />}
    </>
   )}
  </Media>
 );
};

export const SreenLarge = () => {
 return (
  <div className='wrp-subject-current'>
   <ViewText />
  </div>
 )
};
export const SreenSmall = () => {
 return (
  <div className='wrp-subject-current-sm'>
   <ViewText />
  </div>
 )
};

export const ViewText = () => (
 <h1>Balance disponible</h1>
)
